/**
 * Formats airport information based on IATA code.
 * @param iataCode Airport IATA code
 * @param format 'city' | 'airport' | 'both' | 'full'
 * @returns Formatted string
 */
export function formatAirportName(iataCode: string, format: 'city' | 'airport' | 'both' | 'full' = 'city'): string {
    const info = AIRPORT_NAMES[iataCode];
    if (!info) return iataCode;

    const cityName = info.city || iataCode;
    const airportName = info.name || '';

    switch (format) {
        case 'city': return cityName;
        case 'airport': return airportName || cityName;
        case 'both': return airportName ? cityName + ' (' + airportName + ')' : cityName;
        case 'full': return airportName ? cityName + ' - ' + airportName : cityName;
        default: return cityName;
    }
}
